import React, { useState } from "react";
import axios from "axios";

export default function MakeNotiOpen() {
  const [Notification, SetNotifications] = useState(0);

  const handleSubmit = async (e) => {
    try {
      await axios
        .get("http://127.0.0.1:8000/api/notReednotifications")
        .then((respone) => {
          SetNotifications(respone.data.notifications);
          console.log("Notification", Notification);
        });
      UpdateNoti();
      console.log("notifications added successfully");
    } catch (error) {
      console.error("Error adding notifications:", error.message);
    }
  };

  handleSubmit();

  return null;
}
